import React from 'react'
import "./EmployeeTable.css";
import Employee from '../Employee/Employee';

function EmployeeTable() {
  return (
    <div className='employeeTable'>

          <div className="description">
              <h3 className='fullName'>Full Name</h3>
              <h3>Job title</h3>
              <h3>Department</h3>
              <h3>Gender</h3>
              <h3>Age</h3>
          </div>
          <Employee fullName="Kal El" jobTitle="Controls Engineer" department="Engineering" gender="Male" age="33"/>
          <Employee fullName="Optimus Prime" jobTitle="Controls Engineer" department="Engineering" gender="Male" age="33"/>


    </div>
  )
}

export default EmployeeTable
